class Node extends Component {
	state = {
		row: null,
		col: null
	}
    cum() {
        
        console.log(`row-${this.state.row} col-${this.state.col}`);
    }

    render() {
        const { row, col } = this.props;
		test = (row, col) => {
			this.setState({
				col: col,
				row, row
			})
		}
		
        return (
            <div>
                <div className="node" id={`row-${row} col-${col}`} onClick={this.cum}></div>
            </div>
        );
    }
}

export default Node;
